var doc=document,win=window,curr,w,h,sz;
var rnd=Math.random,max=Math.max,min=Math.min,PI=Math.PI;
var floor=Math.floor,round=Math.round;
var CVS=doc.querySelector("#comp1"),CVS2=doc.querySelector("#comp2");
var C=CVS.getContext("2d"),C2=CVS2.getContext("2d");

var imgEls=[], imgs = [
"",
"",
""
];
function clearC2(){ C2.clearRect( 0, 0, w, h ) }
function xhrIsReady( xhr ){ return xhr.readyState === 4 && xhr.status === 200; }
function xhrPOST( url, callback ){
	var xhr = new XMLHttpRequest();
	xhr.onreadystatechange = function(){
		if ( xhrIsReady(xhr) ){
			callback( xhr.response );
		}
	}
	xhr.open( "POST", url );
	xhr.send();
}
function canvasAction( callback ){
	C.save();
	C2.save();
	C.beginPath();
	callback( [].slice.call(arguments,1) );
	C.restore();
	C2.restore();
}
function transWithAnchor( x, y, C, callback ){
	C.translate( x, y );
	callback( [].slice.call(arguments,3) );
	C.translate( x*-1, y*-1 );
}
function handleKeyPress(){
	switch (event.charCode){
	case 32: // spacebar
		event.preventDefault();
		render();
		break;
	case 106: // j
		break;
	case 107: // k
		break;
	default:
		break;
	}
}
function addShape(shape,s,o,C){
	var vs=shape.v, is=shape.i||null, os=shape.o||null;
	var w = artBG1.width, h = artBG1.height;
	var x=(o?o[0]:w/2), y=(o?o[1]:h/2), l=vs.length, ax,ay,bx,by,cx,cy,i,j,k;
	var px = x+vs[l-1][0]*sz*s[0], py = y+vs[l-1][1]*sz*s[1];
	var vx1, vy1, vx2, vy2;
	C.beginPath();
	C.moveTo( px, py );
	for( i=l; i<=l*2; i++ ){
		j=(i-1)%l, k=i%l;
		vx1 = vs[j][0]*sz, vy1 = vs[j][1]*sz;
		vx2 = vs[k][0]*sz, vy2 = vs[k][1]*sz;
		cx = x + vx2 * s[0];
		cy = y + vy2 * s[1];
		if ( is && os ){
			osx = os[j][0]*sz, osy = os[j][1]*sz;
			isx = is[k][0]*sz, isy = is[k][1]*sz;
			ax = x + (vx1 + osx) * s[0];
			ay = y + (vy1 + osy) * s[1];
			bx = x + (vx2 + isx) * s[0];
			by = y + (vy2 + isy) * s[1];
			C.bezierCurveTo( ax, ay, bx, by, cx, cy );
		} else {
			C.lineTo( cx, cy );
		}
	}
	C.closePath();
}
function fill(){
	C.fill();
}
function renderShape( shape, s, o, C ){
	var id;
	addShape( shape, s, o, C );
	if ( shape.c.fs ){
		C.fillStyle = shape.c.fs;
		C.fill();
	}
	if ( shape.stroke ){
		C.lineWidth = shape.lineWidth;
		C.strokeStyle = shape.strokeStyle;
		C.stroke();
	}
}
function toArray( o ){
	var a = [], p;
	for( p in o ){
		if ( p === "width" || p === "height" ){
			continue;
		}
		a.push( o[p] );
	}
	return a;
}
function renderLayer( layer ){
	var a = toArray( layer ), i;
	for( i=a.length-1; i>=0; i-- ){
		renderShape( a[i], [1,-1], [0,0], C );
	}
}
function render( i ){
	if ( typeof i === "undefined" ){
		curr = (curr+1)%imgs.length;
	} else {
		curr = i;
	}
	C.drawImage( imgEls[curr], 0, 0, w, h );
}
function setSize(){
	CVS.setAttribute( "width", w );
	CVS.setAttribute( "height", h );
	CVS.setAttribute( "width", w );
	CVS.setAttribute( "height", h );
	CVS.style.width = w*sz+"px";
	CVS.style.height = h*sz+"px";
	CVS.style.width = w*sz+"px";
	CVS.style.height = h*sz+"px";
}
function getRatio(){
	var dpr = window.devicePixelRatio || 1;
	var bsr = (
		C.webkitBackingStorePixelRatio ||
		C.mozBackingStorePixelRatio ||
		C.msBackingStorePixelRatio ||
		C.oBackingStorePixelRatio ||
		C.backingStorePixelRatio || 1
	);
	return dpr / bsr;
}
function loadImgs(){
	var img, i;
	for( i=0; i<imgs.length; i++ ){
		img = document.createElement( "img" );
		img.src = "data:image/jpeg; base64," + imgs[i];
		img.style.display = "none";
		document.body.appendChild( img )
		imgEls.push( img );
	}
}
function init( fixed ){
	loadImgs();
	sz = 0.5;
	curr = 0;
	imgEls[0].onload = function(){
		w = imgEls[0].width;
		h = imgEls[0].height;
		setSize();
		render(0);
	}
}
function main(){
	init();
}
main();
